import React from "react";

import { withRouter } from "react-router";

import { CardContainer, Image } from "./carousel-card.styles";

const CarouselCard = ({ item, history, url, linkUrl }) => {
  console.log("keyyyy", url);
  return (
    <CardContainer className="carousel__card">
      <Image
        onClick={() => history.push(`${url}${linkUrl}`)}
        src={item.imageUrl}
      />
    </CardContainer>
  );
};

export default withRouter(CarouselCard);
